import React, { Component } from 'react';
import './App.css';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import Rain from './images/whenitrains.jpg'
import Color from './images/soundsofcolor.jpg'
import Shanghai from './images/loveshanghai.jpg'
import Caprica from './images/caprica.jpg'

class Portfolio extends Component {
// state goes here



// functions go here


  render() {
    return (
      <div id="portfolio">
      <div id="header">Portfolio</div>
      <div id="spring2019"> Spring 2019 </div>
        <div id="spring2019projects">
        </div>
      <div id="fall2018"> Fall 2018 </div>
        <div id="fall2018projects">
          <img id="project" src={Rain} alt="When it Rains"/>
          <img id="project" src={Color} alt="The Sounds of Color"/>
          <img id="projectnobottom" src={Shanghai} alt="From Shanghai With Love"/>
          <img id="projectnobottom" src={Caprica} alt="Caprica"/>
        </div>
      </div>
    );
  }
}
export default Portfolio;
